import React from 'react';

class Case extends React.Component{
  constructor(props) {
    super(props);
    this.state = {
      color: "white"
    }
    this.change = this.change.bind(this)
  }

  render() {
    return (
      <div className={"rond"+this.props.aorb} onClick={this.change}>
      </div>
    );
  }
}

export default Case;
